DROP TABLE IF EXISTS `listing_metadata`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `listing_metadata` (
  `id_listing` bigint NOT NULL,
  `property_name` varchar(255) DEFAULT NULL COMMENT 'Property name',
  `city` varchar(100) DEFAULT NULL COMMENT 'City location',
  `state` varchar(50) DEFAULT NULL COMMENT 'State/province',
  `country` varchar(50) DEFAULT 'USA',
  `property_type` varchar(50) DEFAULT NULL COMMENT 'apartment, house, studio, etc.',
  `bedrooms` int DEFAULT NULL COMMENT 'Number of bedrooms',
  `bathrooms` decimal(3,1) DEFAULT NULL COMMENT 'Number of bathrooms',
  `max_guests` int DEFAULT NULL COMMENT 'Maximum guest capacity',
  `airbnb_url` varchar(500) DEFAULT NULL COMMENT 'Direct link to Airbnb listing',
  `is_active` tinyint(1) DEFAULT '1' COMMENT 'Whether listing is currently active',
  `last_updated` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id_listing`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Additional metadata about listings';
