DROP TABLE IF EXISTS `listing_metrics`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `listing_metrics` (
  `id` int NOT NULL AUTO_INCREMENT,
  `id_listing` bigint NOT NULL,
  `week_start` date NOT NULL,
  `view_rate` decimal(10,6) DEFAULT NULL COMMENT 'views / appearances',
  `conversion_rate` decimal(10,6) DEFAULT NULL COMMENT 'bookings / views',
  `search_to_booking_rate` decimal(10,6) DEFAULT NULL COMMENT 'bookings / appearances',
  `avg_appearance_4week` decimal(10,2) DEFAULT NULL COMMENT '4-week average appearances',
  `avg_views_4week` decimal(10,2) DEFAULT NULL COMMENT '4-week average views',
  `avg_bookings_4week` decimal(10,2) DEFAULT NULL COMMENT '4-week average bookings',
  `wow_appearance_change_pct` decimal(10,2) DEFAULT NULL COMMENT 'Week-over-week % change in appearances',
  `wow_view_change_pct` decimal(10,2) DEFAULT NULL COMMENT 'Week-over-week % change in views',
  `wow_booking_change_pct` decimal(10,2) DEFAULT NULL COMMENT 'Week-over-week % change in bookings',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_metric` (`id_listing`,`week_start`),
  KEY `idx_listing` (`id_listing`),
  KEY `idx_week` (`week_start`)
) ENGINE=InnoDB AUTO_INCREMENT=1412 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Calculated performance metrics and rolling averages';
/*!40101 SET character_set_client = @saved_cs_client */;

